import React, { Component } from "react";
import "./App.css";
import ReactTable from "react-table-6";
import { MainTemplate } from "./components";
//import "react-table/react-table.css";

class App extends Component {
  render() {
    return (
      <div>
        <Router>
          <Switch>
            <Route path="/">
              <MainTemplate />
            </Route>
          </Switch>
        </Router>
        <Notification />
        <Loader />
      </div>
    );
  }
}

export default App;
